import React from 'react';
import './App.css';

const Podcast = ({ season, episode, episodeTitle }) => {
  return (
    <div className="podcast">
      <h3 className="podcast-episode">Season {season}, Episode {episode}</h3>
      <p className="podcast-title">Episode Title: {episodeTitle}</p>
    </div>
  );
};

export default Podcast;
